import React, { useState, useEffect } from 'react';
import {
  Box, Typography, Button, Container, Card, CardContent, Grid,
  Accordion, AccordionSummary, AccordionDetails, Paper, CardMedia, CardActions
} from '@mui/material';
import { styled } from '@mui/system';
import { motion, AnimatePresence } from "framer-motion";
import ImageGallery from 'react-image-gallery';
import { ParallaxProvider, Parallax as ParallaxScroll, Parallax as ParallaxReact } from 'react-scroll-parallax';
import ScrollProgressBar from 'react-scroll-progress-bar';
import {
  CommentIcon, StarIcon, HistoryIcon, NoMeetingRoomIcon, CleanHandsIcon,
  TimerIcon, AttachMoneyIcon, CurrencyBitcoinIcon, BusinessIcon, VolumeOffIcon
} from '@mui/icons-material';
import { green } from '@mui/material/colors';
import Typist from 'react-typist';
import SovereignLogo from '../assets/Asset_5.png';
import ChevronRightIcon from '@mui/icons-material/ChevronRight';

// Custom Button Styled Component
const CustomButton = styled(Button)({
  backgroundColor: '#ff6f61',
  color: 'white',
  padding: '10px 20px',
  '&:hover': {
    backgroundColor: '#ff8566',
  },
  // Additional styling can be added here
});

// Background Styled Component
const Background = styled('div')({
  position: 'absolute',
  top: 0,
  left: 0,
  width: '100%',
  height: '100%',
  "&::before": {
    content: '""',
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    backgroundColor: 'rgba(0,0,0,0.3)',
    zIndex: 1,
  },
});

// Styled Parallax Component
const StyledParallax = styled(ParallaxReact)({
  position: 'relative',
  height: '90vh',
  // Additional styling can be added here
});

// Service List Content
const serviceList = [
  // Update this array with Aires BnB specific services
  {
    title: "Effortless Management",
    description: "Complete handling of booking, hosting, cleaning, and maintenance.",
    icon: <NoMeetingRoomIcon fontSize="large" sx={{ color: green[500] }} />,
  },
  // ... other services
];

// Image Gallery Content
const images = [
  // Update this array with images of properties managed by Aires BnB
  {
    original: 'https://a0.muscache.com/im/pictures/miso/Hosting-756042222497511873/original/c953a450-7ac5-4a3f-b2b9-cc65f7bb8663.jpeg?im_w=720',
    thumbnail: 'https://a0.muscache.com/im/pictures/miso/Hosting-756042222497511873/original/c953a450-7ac5-4a3f-b2b9-cc65f7bb8663.jpeg?im_w=720',
  },
  // ... other images
];

// FAQs Content
const faqs = [
  // Update this array with frequently asked questions relevant to Aires BnB
  {
    question: "What makes Aires BnB unique in property management?",
    answer: "Aires BnB offers a comprehensive management package, ensuring properties are well-maintained, bookings are efficiently managed, and maximum rental income is achieved."
  },
  // ... other FAQs
];

const Home = () => {
  const tagline = "Experience the Future of Property Management with Aires BnB";
  const visibleTagline = useTypewriterEffect(tagline, 4000); // Typewriter effect duration in milliseconds

  const [searchValue, setSearchValue] = useState('');

  return (
    <div>
      <ScrollProgressBar height="5px" bgColor="#5cb85c" duration="1" />
      <StyledParallax
        blur={0}
        bgImage="path/to/your/hero-image.jpg" // Replace with your hero image path
        strength={200}
      >
        <Background />
        <Box display="flex" alignItems="center" justifyContent="center" height="100%">
          <Container maxWidth="sm">
            <Typography variant="h2" color="inherit" gutterBottom sx={{ textShadow: '2px 2px 4px rgba(0, 0, 0, 0.5)' }}>
              {visibleTagline}
            </Typography>
            <CustomButton>Discover More</CustomButton>
          </Container>
        </Box>
      </StyledParallax>

      {/* Services Section */}
      <Container maxWidth="md" sx={{ my: 5 }}>
        <Typography variant="h4" component="h2" align="center" gutterBottom>
          What We Offer
        </Typography>
        <Grid container spacing={3}>
          {serviceList.map((service, index) => (
            <Grid item xs={12} sm={4} key={index}>
              <Card sx={{ minHeight: 275 }}>
                <CardContent>
                  <Box display='flex' flexDirection='column' alignItems='center' mb={2}>
                    {service.icon}
                    <Typography variant="h5" component="div" gutterBottom>
                      {service.title}
                    </Typography>
                  </Box>
                  <Typography variant="body2" color="text.secondary">
                    {service.description}
                  </Typography>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>

      {/* Property Gallery Section */}
      <Container maxWidth="md" sx={{ my: 5 }}>
        <Typography variant="h4" component="h2" align="center" gutterBottom>
          Property Gallery
        </Typography>
        {/* Implement Image Gallery here */}
      </Container>

      {/* FAQ Section */}
      <Container maxWidth="md" sx={{ my: 5 }}>
        <Typography variant="h4" component="h2" align="center" gutterBottom>
          Frequently Asked Questions
        </Typography>
        <input 
          type="text" 
          placeholder="Search FAQs..." 
          value={searchValue} 
          onChange={(e) => setSearchValue(e.target.value)} 
        />
        {faqs
          .filter(faq => faq.question.toLowerCase().includes(searchValue.toLowerCase()))
          .map((faq, index) => (
            <Accordion key={index}>
              <AccordionSummary expandIcon={<ExpandMoreIcon />}>
                <Typography>{faq.question}</Typography>
              </AccordionSummary>
              <AccordionDetails>
                <Typography>{faq.answer}</Typography>
              </AccordionDetails>
            </Accordion>
          ))
        }
      </Container>
    </div>
  );
};

export default Home;
